//SPDX-License-Identifier: MIT

pragma solidity >=0.4.17 <0.9.0;
pragma experimental ABIEncoderV2;

contract vote {
    struct _voter {
        string color;
        address person;
    }

    _voter[] public voter_red;
    _voter[] public voter_blue;
    uint256 public votes_count = 0; 
    uint256 internal red_voter = 0; 
    uint256 internal blue_voter = 0;

    function Red(address _person) public{

        string memory _color = "Red";
        voter_red.push(_voter({color: _color, person: _person}));
        votes_count++;
        red_voter++;



    }

    function Blue(address _person) public{

        string memory _color = "Blue";
        voter_blue.push(_voter({color: _color, person: _person}));
        votes_count++;
        blue_voter++;

    }

    function TotalVotes()view public returns(uint256){
      return votes_count;
    }

    function RedVotes()view public returns(uint256){
      return red_voter;
    }

    function BlueVotes()view public returns(uint256){
      return blue_voter;
    }
}
